import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App" style={{ minHeight: '100vh', background: '#f4f6fa', display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center' }}>
      <header style={{ marginBottom: 32 }}>
        <h1 style={{ color: '#1976d2', fontWeight: 700, fontSize: '2.5rem', letterSpacing: 1 }}>Image Puzzle Solver</h1>
        <p style={{ color: '#333', fontSize: '1.2rem' }}>A modern web interface for solving image puzzles</p>
      </header>
      <main>
        <div style={{ padding: 32, background: '#fff', borderRadius: 12, boxShadow: '0 2px 8px rgba(0,0,0,0.07)' }}>
          <p>Welcome! Start building your image puzzle solver features here.</p>
        </div>
      </main>
    </div>
  );
}

export default App;
